import React from 'react';

export default function Login(){
    return (
        <>
            <form>
                <lable>Name</lable>
                <input type='text' />
                <label>Role</label>
                <select>
                    <option>User</option>
                    <option>Reviewer</option>
                    <option>Admin</option>
                </select>
            </form>
        </>
    );
}
